import "../App.css";
import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faBoltLightning,
  faCloud,
  faLocationDot,
  faSmog,
  faSnowman,
  faSun,
  faTint,
} from "@fortawesome/free-solid-svg-icons";

function WeatherMood(props) {
  let icon;
  if (props.mood === "Clear")
    icon = <FontAwesomeIcon icon={faSun} className="PostBarSelectIcon" />;
  return props.content === "" ? (
    <div></div>
  ) : (
    <div className="WeatherMood">
      <div className="WeatherMoodIcon">
        {icon}
        {props.mood}
      </div>
      <div className="WeatherMoodText">{props.content}</div>
    </div>
  );
}

export default WeatherMood;
